  "translationLines": [
    {
      "lineNumber": 141841,
      "originalJapaneseLine": "　闇の翼の頭領をやってるすごいアサシンさん」",
      "translatedEnglishLine": "The amazing assassin who is the leader of the Dark Wings."
    },
    {
      "lineNumber": 141842,
      "originalJapaneseLine": "「初めまして。",
      "translatedEnglishLine": "\"Nice to meet you."
    },
    {
      "lineNumber": 141843,
      "originalJapaneseLine": "　一応、今は兼業でかなみ隊長の部下でもあるわ」",
      "translatedEnglishLine": "For now, I'm also working part-time as Captain Kanami's subordinate."
    },
    {
      "lineNumber": 141844,
      "originalJapaneseLine": "「え？」",
      "translatedEnglishLine": "\"Huh?\""
    },
    {
      "lineNumber": 141845,
      "originalJapaneseLine": "「ちなみに実力はかなみより上だ」",
      "translatedEnglishLine": "\"By the way, my skills are better than Kanami's.\""
    },
    {
      "lineNumber": 141846,
      "originalJapaneseLine": "「え？　え？　え？」",
      "translatedEnglishLine": "\"Eh? Eh? Eh?\""
    },
    {
      "lineNumber": 141847,
      "originalJapaneseLine": "「残念ながら事実なの……うう……」",
      "translatedEnglishLine": "\"Unfortunately, it's true... uh...\""
    },
    {
      "lineNumber": 141848,
      "originalJapaneseLine": "「あら、なんで泣いてるのかしら。",
      "translatedEnglishLine": "\"Oh my, why are you crying?"
    },
    {
      "lineNumber": 141849,
      "originalJapaneseLine": "　不思議な隊長ね」",
      "translatedEnglishLine": "What a peculiar captain.\""
    },
    {
      "lineNumber": 141850,
      "originalJapaneseLine": "どこまで本気なのか、",
      "translatedEnglishLine": "Just how serious she is,"
    },
    {
      "lineNumber": 141851,
      "originalJapaneseLine": "フレイアは無表情のまま肩を竦めた。",
      "translatedEnglishLine": "Freya shrugged her shoulders expressionlessly."
    },
    {
      "lineNumber": 141852,
      "originalJapaneseLine": "「それよりお前は何故ここに」",
      "translatedEnglishLine": "\"More importantly, why are you here?\""
    },
    {
      "lineNumber": 141853,
      "originalJapaneseLine": "「今日はこの近くの村の人達の保護。",
      "translatedEnglishLine": "\"Today is about protecting the people of a nearby village."
    },
    {
      "lineNumber": 141854,
      "originalJapaneseLine": "　それと、魔軍の偵察ね」",
      "translatedEnglishLine": "And also reconnaissance of the demon army.\""
    },
    {
      "lineNumber": 141855,
      "originalJapaneseLine": "「今回の戦いでは闇の翼もかり出されているから、",
      "translatedEnglishLine": "\"The Dark Wings have also been deployed in this battle,"
    },
    {
      "lineNumber": 141856,
      "originalJapaneseLine": "　色々と大変なのよ」",
      "translatedEnglishLine": "so it's been quite tough in various ways.\""
    },
    {
      "lineNumber": 141857,
      "originalJapaneseLine": "「魔物隊長クラスは何名か暗殺に成功したけど、",
      "translatedEnglishLine": "\"We've managed to assassinate several monster captains,"
    },
    {
      "lineNumber": 141858,
      "originalJapaneseLine": "　魔物将軍クラスは近づく隙がないのもあって",
      "translatedEnglishLine": "but for monster generals, there's no chance to get close,"
    },
    {
      "lineNumber": 141859,
      "originalJapaneseLine": "　なかなか倒せないしね」",
      "translatedEnglishLine": "so it's been hard to defeat them.\""
    },
    {
      "lineNumber": 141860,
      "originalJapaneseLine": "「ふふん、俺様に任せておけ」",
      "translatedEnglishLine": "\"Heh, leave it to me.\""
    },
    {
      "lineNumber": 141861,
      "originalJapaneseLine": "「それで、大将達はどうしてここに？」",
      "translatedEnglishLine": "\"So, why are the generals here?\""
    },
    {
      "lineNumber": 141862,
      "originalJapaneseLine": "「今からバボラを倒しに行くのだ。",
      "translatedEnglishLine": "\"We're going to defeat Babora now."
    },
    {
      "lineNumber": 141863,
      "originalJapaneseLine": "　で、敵に会わずに行けるルートを探して、",
      "translatedEnglishLine": "We've been having Kanami scout for a route to avoid enemies."
    },
    {
      "lineNumber": 141864,
      "originalJapaneseLine": "　かなみに探索させていたところだ」",
      "translatedEnglishLine": "\""
    },
    {
      "lineNumber": 141865,
      "originalJapaneseLine": "「ああ、それなら右に行きなさい。",
      "translatedEnglishLine": "\"Ah, if that's the case, go to the right."
    },
    {
      "lineNumber": 141866,
      "originalJapaneseLine": "　魔物に会わないわけじゃないけど、",
      "translatedEnglishLine": "You might encounter monsters, but"
    },
    {
      "lineNumber": 141867,
      "originalJapaneseLine": "　左に行くよりもよっぽどマシだから」",
      "translatedEnglishLine": "it's much better than going left.\""
    },
    {
      "lineNumber": 141868,
      "originalJapaneseLine": "「えっ……！」",
      "translatedEnglishLine": "\"Eh...!\""
    },
    {
      "lineNumber": 141869,
      "originalJapaneseLine": "「あら、もしかしたら左に行くつもりだった？」",
      "translatedEnglishLine": "\"Oh my, were you perhaps planning to go left?\""
    },
    {
      "lineNumber": 141870,
      "originalJapaneseLine": "「そんなわけないわよね。",
      "translatedEnglishLine": "\"That's impossible, right?"
    },
    {
      "lineNumber": 141871,
      "originalJapaneseLine": "　隊長ともあろう人が」",
      "translatedEnglishLine": "After all, you're the captain.\""
    },
    {
      "lineNumber": 141872,
      "originalJapaneseLine": "「もも、もちろんですよ。",
      "translatedEnglishLine": "\"Of course not."
    },
    {
      "lineNumber": 141873,
      "originalJapaneseLine": "　あははは……」",
      "translatedEnglishLine": "Ha ha ha...\""
    },
    {
      "lineNumber": 141874,
      "originalJapaneseLine": "「……へっぽこ忍者」",
      "translatedEnglishLine": "\"...Lousy ninja.\""
    },
    {
      "lineNumber": 141875,
      "originalJapaneseLine": "「それにしても、お前もヘルマンの為に",
      "translatedEnglishLine": "\"Still, you've come to fight for Hellman as well."
    },
    {
      "lineNumber": 141876,
      "originalJapaneseLine": "　戦うようになったか」",
      "translatedEnglishLine": "\""
    },
    {
      "lineNumber": 141877,
      "originalJapaneseLine": "「私の目的はいつだって、",
      "translatedEnglishLine": "\"My goal has always been"
    },
    {
      "lineNumber": 141878,
      "originalJapaneseLine": "　組織の存続、全てはその為の働きよ」",
      "translatedEnglishLine": "the preservation of the organization; everything I do serves that purpose.\""
    },
    {
      "lineNumber": 141879,
      "originalJapaneseLine": "「ま、人類が滅亡したらそれ以前の問題だしね」",
      "translatedEnglishLine": "\"Well, if humanity is extinguished, that's an even bigger problem.\""
    },
    {
      "lineNumber": 141880,
      "originalJapaneseLine": "「うむ、それではちょちょっと",
      "translatedEnglishLine": "\"Alright then, I'll just quickly"
    },
    {
      "lineNumber": 141881,
      "originalJapaneseLine": "　バボラを倒しに行ってくる」",
      "translatedEnglishLine": "go defeat Babora.\""
    },
    {
      "lineNumber": 141882,
      "originalJapaneseLine": "「近くにいない方がいいぞ。",
      "translatedEnglishLine": "\"It's better if you stay away."
    },
    {
      "lineNumber": 141883,
      "originalJapaneseLine": "　あんな奴の下敷きにはなりたくないだろうからな。",
      "translatedEnglishLine": "You don't want to get crushed under someone like that."
    },
    {
      "lineNumber": 141884,
      "originalJapaneseLine": "　がははははははは！」",
      "translatedEnglishLine": "\"Gahahahahahaha!\""
    },
    {
      "lineNumber": 141885,
      "originalJapaneseLine": "「はいはい。",
      "translatedEnglishLine": "\"Alright, alright."
    },
    {
      "lineNumber": 141886,
      "originalJapaneseLine": "　それじゃ、気をつけて行ってらっしゃい」",
      "translatedEnglishLine": "Well then, take care and have a good trip.\""
    },
    {
      "lineNumber": 141887,
      "originalJapaneseLine": "魔軍ヘルマン支部本陣――",
      "translatedEnglishLine": "Demon Army Hellman Branch Headquarters――"
    },
    {
      "lineNumber": 141888,
      "originalJapaneseLine": "ケイブリスにより",
      "translatedEnglishLine": "By Cavebris,"
    },
    {
      "lineNumber": 141889,
      "originalJapaneseLine": "ヘルマン方面制圧を任された魔人は、",
      "translatedEnglishLine": "the demons entrusted with the subjugation of the Hellman region are,"
    },
    {
      "lineNumber": 141890,
      "originalJapaneseLine": "魔人ケッセルリンクと魔人バボラの両名である。",
      "translatedEnglishLine": "the two demons Kesselring and Babora."
    }
  ]
}

